import React, { Component } from "react";

class Title extends Component {
  constructor() {
    super();

    this.objeto = [
      {
        id: 1,
        nombre: "Carlos",
        apellido: "Rivera",
      },

      {
        id: 2,
        nombre: "Ariel",
        apellido: "Gaitan",
      },

      {
        id: 3,
        nombre: "Kendall",
        apellido: "Ocampo",
      },
    ];
  }
  render() {
    return (
      <div className="Center">
        
          <div>
            <p>{this.props.nombre}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default Title;
